l -->\n                <!-- ko text: element[attribute].value --><!-- /ko --><br/>\n            <!-- /ko -->\n            <!-- ko if: element[attribute].value == null -->\n                <!-- ko text: element[attribute] --><!-- /ko --><br/>\n            <!-- /ko -->\n         <!-- /ko -->\n    <!-- /ko -->\n    <!-- ko if: (address().isEditable()) -->\n    <button type=\"button\"\n            class=\"action edit-address-link\"\n            data-bind=\"click: editAddress, visible: address().isEditable()\">\n        <span data-bind=\"i18n: 'Edit'\"></span>\n    </button>\n    <!-- /ko -->\n    <button type=\"button\" data-bind=\"click: selectAddress\" class=\"action action-select-shipping-item\">\n        <span data-bind=\"i18n: 'Ship Here'\"></span>\n    </button>\n</div>\n","Magento_Checkout/template/minicart/subtotal.html":"<!--\n/**\n * Copyright \u00c2\u00a9 Magento, Inc. All rights reserved.\n * See COPYING.txt for license details.\n */\n-->\n<div class=\"subtotal\">\n    <span class=\"label\">\n        <!-- ko i18n: 'Cart Subtotal' --><!-- /ko -->\n    </span>\n\n    <!-- ko foreach: elems -->\n        <!-- ko template: getTemplate() --><!-- /ko -->\n    <!-- /ko -->\n</div>\n","Magento_Checkout/template/minicart/content.html":"<!-- ko if: getCartParam('summary_count') -->\n<div class=\"block-content\">\n    <div id=\"added-message\" class=\"added-message\">\n        <p>\n            <svg><use xmlns:xlink=\"http://www.w3.org/1999/xlink\" xlink:href=\"#icon-check\"></use></svg>\n            <!-- ko i18n: 'ITEM_WAS_ADDED_TO_YOUR_CART' --><!-- /ko -->\n        </p>\n    </div>\n\n    <div class=\"column-head clearfix\">\n        <div class=\"col-sm-3\"><!-- ko i18n: 'Qty' --><!-- /ko --></div>\n        <div class=\"col-sm-6\"><!-- ko i18n: 'Product name' --><!-- /ko --></div>\n        <div class=\"col-sm-3 text-right\"><!-- ko i18n: 'UNIT_PRICE' --><!-- /ko --></div>\n    </div>\n\n    <ul id=\"mini-cart\" class=\"mini-products-list\" data-bind=\"css: { slideable